import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from './components/Home';
import Find_Animals from './components/Find_Animals';
import Header from './components/header';
import Footer from './components/footer';

function App() {
  const siteInfo = {
    title: "WebPets",
    year: 2025,
    email: "helpAnimal@mail.ru",
    phone: "+7 (931) 562-231-32"
  };

  const userInfo = {
    isLoggedIn: false,
    userName: "Гость"
  };

  return (
    <div>
      <Header 
        siteTitle={siteInfo.title} 
        userInfo={userInfo}
      />
      <Routes>
        <Route 
          path={'/'} 
          element={<Home 
            siteInfo={siteInfo}
            userInfo={userInfo}
          />}
        />
        <Route 
          path={'/find_animals'} 
          element={<Find_Animals 
            siteInfo={siteInfo}
            userInfo={userInfo}
          />}
        />
      </Routes>
      <Footer 
        siteInfo={siteInfo}
      />
    </div>
  );
}

export default App;
